/**
You are given a 0-indexed integer array nums of even length consisting of an equal number of positive and negative integers. You should return the array of nums such that
the the array follows the given conditions:

Every consecutive pair of integers have opposite signs.
    For all integers with the same sign, the order in which they were present in nums is preserved.
    The rearranged array begins with a positive integer.
    Return the modified array after rearranging the elements to satisfy the aforementioned conditions.

Input: nums = [3,1,-2,-5,2,-4]
Output: [3,-2,1,-5,2,-4]
Explanation:
The positive integers in nums are [3,1,2]. The negative integers are [-2,-5,-4].
The only possible way to rearrange them such that they satisfy all conditions is [3,-2,1,-5,2,-4].
Other ways such as [1,-2,2,-5,3,-4], [3,1,2,-2,-5,-4], [-2,3,-5,1,-4,2] are incorrect because they do not satisfy one or more conditions.
*********8*/

/**
 * @param {number[]} nums
 * @return {number[]}
 */
var rearrangeArray = function(nums) {
    let p1 = 0;
    let p2 = 0;

    while(p1 < nums.length - 1) {
        let even = p1 % 2 === 0;
        if(even && nums[p1] >= 0) {
            p1++
            p2++
        } else if (!even && nums[p1] < 0) {
            p1++
            p2++
        } else if (even && nums[p1] < 0) {
            while(p2 < nums.length) {
                if(nums[p2] > 0) {
                    nums.splice(p1, 0, nums.splice(p2, 1)[0])
                    p1++
                    p2 = p1
                    break;
                }
                p2++
            }
        } else {
            while(p2 < nums.length) {
                if(nums[p2] < 0) {
                    nums.splice(p1, 0, nums.splice(p2, 1)[0])
                    p1++;
                    p2 = p1;
                    break;
                }
                p2++
            }
        }
    }
    return nums;
};

// With creating new Array
const rearrangeArray1 = (nums) => {
    let even = [];
    let odd = [];
    let result = [];

    for(let i = 0; i < nums.length; i++) {
        if(nums[i] >= 0) {
            even.push(nums[i])
        } else {
            odd.push(nums[i])
        }
    }

    for(let j = 0; j < even.length; j++) {
        result.push(even[j]);
        result.push(odd[j]);
    }
    return result;
}

